local OPEN_PRIZES = {};

local function AddOpenPrize(playerName, amount)
    if (OPEN_PRIZES[playerName] == nil) then
        OPEN_PRIZES[playerName] = amount;
    else
        OPEN_PRIZES[playerName] = OPEN_PRIZES[playerName] + amount;
    end
